import{p as u}from"./page-21e76907.js";import{_ as F,c as E,o as a,G as B}from"./index-3a17f0ec.js";const C={...u},t=""+new URL("图片1-7f9fb4bd.png",import.meta.url).href,D=""+new URL("图片2-78eb6582.png",import.meta.url).href,p=""+new URL("图片3-8ba5d4c1.png",import.meta.url).href,A=""+new URL("图片4-32a7efef.png",import.meta.url).href,i=""+new URL("图片5-d571607b.png",import.meta.url).href,r=""+new URL("图片6-202ff9f9.png",import.meta.url).href,d=""+new URL("图片7-b5002438.png",import.meta.url).href,e=""+new URL("图片8-dd7f7ff5.png",import.meta.url).href,s=""+new URL("图片9-6352dd36.png",import.meta.url).href,o=""+new URL("图片10-80eca951.png",import.meta.url).href,m=""+new URL("图片11-e44e22f7.png",import.meta.url).href,_=""+new URL("图片12-c524a744.png",import.meta.url).href,n=""+new URL("图片13-6a5c5ce2.png",import.meta.url).href,c=""+new URL("图片14-58f33f15.png",import.meta.url).href,b=""+new URL("图片15-222d6644.png",import.meta.url).href,v=""+new URL("图片16-fef9c0c9.png",import.meta.url).href,h=""+new URL("图片17-9922e383.png",import.meta.url).href;const f={class:"box"},l=B('<h2 id="16.移动指挥箱" data-v-55937ab3>16.移动指挥箱</h2><h3 id="16.1设备介绍" data-v-55937ab3>16.1设备介绍</h3><p data-v-55937ab3>移动指挥箱采用一体化设计，集成了指挥视频终端、摄像头、显示屏、喇叭、麦克风、云台遥杆和电池，支持卫星、4G 和 wifi 等多种网络模式的一键切换。支持外置摄像机，标配的外置摄像机为 20 倍光学变焦，可采集2 公里范围的图像。能够实现定位、应急、视频、云台操作、双向对讲等功能。</p><img src="'+t+'" alt="" data-v-55937ab3><h3 id="16.2面板接口功能介绍" data-v-55937ab3>16.2面板接口功能介绍</h3><h3 id="16.2.1上面板介绍" data-v-55937ab3>16.2.1上面板介绍</h3><img src="'+D+'" alt="" data-v-55937ab3><h3 id="16.2.2下面板介绍" data-v-55937ab3>16.2.2下面板介绍</h3><img src="'+p+'" alt="" data-v-55937ab3><img src="'+A+'" alt="" data-v-55937ab3><img src="'+i+'" alt="" data-v-55937ab3><h3 id="16.3设备操作" data-v-55937ab3>16.3设备操作</h3><h3 id="16.3.1有线网络连接" data-v-55937ab3>16.3.1有线网络连接</h3><p data-v-55937ab3>（1）网线直连方式。</p><img src="'+r+'" alt="" data-v-55937ab3><p data-v-55937ab3>（2）本地局域网连接方式。</p><img src="'+d+'" alt="" data-v-55937ab3><h3 id="16.3.2wifi 热点连接" data-v-55937ab3>16.3.2wifi 热点连接</h3><p data-v-55937ab3>移动指挥箱开机后默认开启状态，通过 wifi 搜索可发现“ap-xxxxx-xx” 格式的网络接入点。例如 AP-122036-5E。连接默认密码未 12345678.连接成功后，通过“内置网页”即可搜索到设备。配置方式与直连配置方式一样。</p><img src="'+e+'" alt="" data-v-55937ab3><h3 id="16.4网络访问和参数配置" data-v-55937ab3>16.4网络访问和参数配置</h3><h3 id="16.4.1通过浏览器访问" data-v-55937ab3>16.4.1通过浏览器访问</h3><p data-v-55937ab3>移动指挥箱支持多种浏览器访问方式，如 IE、Chome、360 等浏览器。以 IE 为例，基本访问步骤和参数配置如下：</p><p data-v-55937ab3>（1）设置安全级别。进入菜单-工具-INTERNET 选项-安全-自定义级别，在设置中把 activex 控件和插件，都改成“启用” 或“提示”，安全级别设置为低。为了安全，在预览到视频图像后，把安全设置恢复默认级别。</p><img src="'+s+'" alt="" data-v-55937ab3><h3 id="16.4.2内置网页登陆" data-v-55937ab3>16.4.2内置网页登陆</h3><p data-v-55937ab3>在浏览器输入“192.168.0.8:9988”。对于首次使用的，要首先下载内置网页插件，按照 20.4.1 操作即可。</p><p data-v-55937ab3>注意：插件下载完成后，打开插件下载目录，关闭浏览器后进行安装， 以免安装失败。</p><p data-v-55937ab3>安装成功后进行登陆，进入内置网页后，用户名：admin，密码：123456.</p><img src="'+o+'" alt="" data-v-55937ab3><h3 id="16.5网络配置" data-v-55937ab3>16.5网络配置</h3><h3 id="16.5.1有线接入" data-v-55937ab3>16.5.1有线接入</h3><p data-v-55937ab3>有线接入无需在内置网页上设置，直接在移动指挥箱安装的 AVCON软件进行网络配置。</p><img src="'+m+'" alt="" data-v-55937ab3><h3 id="16.5.2wifi 接入" data-v-55937ab3>16.5.2wifi 接入</h3><p data-v-55937ab3>登陆内置网页后，点击 ，点击 wifi 功能项，勾选“启用 wifi”，在ssid 中输入无线网账号，在接入密码中输入无线网密码。提交保存，刷新， 观察模块状态，直至连接成功。（注：需要先关闭热点功能）</p><img src="'+_+'" alt="" data-v-55937ab3><img src="'+n+'" alt="" data-v-55937ab3><p data-v-55937ab3>Wifi 设置在内置网页设置完成后需要在移动指挥箱上的 AVCON 软件讲网络设置按照下图设置 IP 和网关后设备才能正常上网。</p><img src="'+c+'" alt="" data-v-55937ab3><h3 id="16.5.34G 接入" data-v-55937ab3>16.5.34G 接入</h3><p data-v-55937ab3>登陆内置网页后，点击 ，进入设备配置。在系统中找到网络配置， 下拉，在“首选网络”中，选择“使用 4G 网络”，提交。</p><p data-v-55937ab3>点击 4G 功能项，可以在状态参数中，查看拨号状态，当显示“拨号成功”时，则表示设备已经接入网络。</p><p data-v-55937ab3>如果使用的 sim 卡为专网卡，则需要在配置参数中，添加 apn、接入号、密码等参数。</p><img src="'+b+'" alt="" data-v-55937ab3><p data-v-55937ab3>4G 设置在内置网页设置完成后，需要在移动指挥箱上的 </p><img src="'+v+'" alt="" data-v-55937ab3><p data-v-55937ab3>AVCON 软件将网络设置按照下图设置 IP 和网关后设备才能正常上网。</p><h3 id="16.6移动指挥箱操作" data-v-55937ab3>16.6移动指挥箱操作</h3><p data-v-55937ab3>（1）移动指挥箱开机后，连接网络，会议终端。</p><p data-v-55937ab3>（2）进入会议终端后，点击右上角选项，进行语音，视频测试。</p><p data-v-55937ab3>（3）测试完毕后组会进行音视频指挥调度。</p><img src="'+h+'" alt="" data-v-55937ab3>',53),g=[l];function w(R,L,U,x,G,I){return a(),E("div",f,g)}const $=F(C,[["render",w],["__scopeId","data-v-55937ab3"]]);export{$ as default};
